INSERT INTO "dashboard_public".object_type_values (attr_id, name, description, text, photo, value_order) VALUES ('393ff77f-40d3-55de-93db-0a53969b400b', 'African Sumac', 'Drought tolerant evergreen offering dense shade, elegant arching branches and subtle flowers in summer. Can live 150 years.', 'African Sumac', '{"url": "https://dl.airtable.com/.attachments/52988b5e03a3181688f90ae49b6a5d0c/dce167c2/SelecTree-Rhus_lancea2.jpg", "mime": "image/jpeg", "size": 102042, "filename": "SelecTree-Rhus_lancea2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Bronze Loquat', 'From Taiwan and Southern Vietnam, it has shiny bronze and green foliage with white flowers in the spring. Moderate water needs. Grows to 25 ft.', 'Bronze Loquat', '{"url": "https://dl.airtable.com/.attachments/d293abd1e9a9f62b67a318924d73aa2d/7f9ef93f/SelecTree-Eriobotrya_deflexa.jpg", "mime": "image/jpeg", "size": 75406, "filename": "SelecTree-Eriobotrya_deflexa.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Crape Myrtle', 'Native to China, with beautiful lavender, pink, red, rose or white flowers in summer. Blooms best in full sun, when it has moderate moisture. Drought tolerant.', 'Crape Myrtle', '{"url": "https://dl.airtable.com/.attachments/23be9677d36c9590be04ee5ef4dcd9e5/efb46585/SelecTree-Lagerstroemia_indica.jpg", "mime": "image/jpeg", "size": 221127, "filename": "SelecTree-Lagerstroemia_indica.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Eastern Redbud', 'Gorgeous pink or rose flowers bloom in spring and its heart shaped leaves turn lemon colored in the fall. This drought tolerant tree is native to the eastern United States.', 'Eastern Redbud', '{"url": "https://dl.airtable.com/.attachments/1a35ea4dc7a3ac2c310e18a1530a0082/6f31c7a2/SelecTree-Cercis_canadensis.jpg", "mime": "image/jpeg", "size": 276088, "filename": "SelecTree-Cercis_canadensis.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Fraser Photinia', 'Shiny reddish evergreen foliage with fragrant white flowers in the spring. This small drought tolerant tree fits perfectly under power lines. Native to Asia.', 'Fraser Photinia', '{"url": "https://dl.airtable.com/.attachments/0de5a63837512c585327bcaca71535a3/2740fd75/photinia--fraseri-tree.jpg", "mime": "image/jpeg", "size": 604321, "filename": "photinia-Ã—-fraseri-tree.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Gold Medallion Tree', 'Elegant low arching canopy with cheerful yellow flowers in the summer. Moderate water needs. Native to Brazil.', 'Gold Medallion Tree', '{"url": "https://dl.airtable.com/.attachments/39b05049e93e041bb6aec07c49c7c429/ac4ae92f/cassia-leptophylla-tree-flowering.jpg", "mime": "image/jpeg", "size": 433441, "filename": "cassia-leptophylla-tree-flowering.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Purple Orchid Tree', 'Drought tolerant tree hailing from India and China. Fragrant lavender or pink flowers in spring or winter decorate a low arching canopy.', 'Purple Orchid Tree', '{"url": "https://dl.airtable.com/.attachments/9e04cbc13f5449e0207578609903286d/8971bbd6/SelecTree-Bauhinia_variegata.jpg", "mime": "image/jpeg", "size": 111012, "filename": "SelecTree-Bauhinia_variegata.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Australian Willow', 'Drought tolerant 35 foot tree with inconspicuous white flowers in either spring or fall.', 'Australian Willow', '{"url": "https://dl.airtable.com/.attachments/cc5dcab39df8dc890761f3f1771cf747/72866dd8/SelecTree-Geijera_parviflora2.jpg", "mime": "image/jpeg", "size": 208099, "filename": "SelecTree-Geijera_parviflora2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Carolina Laurel Cherry', 'Drought tolerant wide canopy tree native to Southeastern United States with fragrant white flowers in spring or winter.', 'Carolina Laurel Cherry', '{"url": "https://dl.airtable.com/.attachments/89577fa7d66c3bff45ad1fb43adb9ddd/279ed8c0/prunus-caroliniana-tree-2.jpg", "mime": "image/jpeg", "size": 682400, "filename": "prunus-caroliniana-tree-2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Chinese Flame Tree', 'Cheerful yellow flowers in summer or fall, native to Asia, and drought tolerant.', 'Chinese Flame Tree', '{"url": "https://dl.airtable.com/.attachments/e56dcac3ddf0aff7a5e9f52cf20cca80/3144aeef/SelecTree-Koelreuteria_bipinnata.jpg", "mime": "image/jpeg", "size": 113517, "filename": "SelecTree-Koelreuteria_bipinnata.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Chinese Pistache', 'Fragrant leaves with flowers in spring. Medium green, red, gold, orange or multicolored in fall. Offers fairly dense shade.', 'Chinese Pistache', '{"url": "https://dl.airtable.com/.attachments/924b0a39e97a7a74d3f0fa25ac96e7a8/4abbfb38/SelecTree-Pistacia_chinensis.jpg", "mime": "image/jpeg", "size": 193005, "filename": "SelecTree-Pistacia_chinensis.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Mesquite', 'Drought tolerant wide canopy tree with fragrant yellow flowers in the spring. Native to Southwestern United States and Northern Mexico.', 'Mesquite', '{"url": "https://dl.airtable.com/.attachments/24aecf43bb3339fab900efe7d8cac85a/c7f221ea/prosopis-glandulosa-torreyana-tree-flowering.jpg", "mime": "image/jpeg", "size": 442813, "filename": "prosopis-glandulosa-torreyana-tree-flowering.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Olive Tree', 'Native to the Mediterranean Region, this olive tree bears fruit in the fall and small fragrant flowers in spring. It is drought and heat tolerant, with a longevity greater than 150 years.', 'Olive Tree', '{"url": "https://dl.airtable.com/.attachments/cfa30a28acb50331949c212ecc954ab9/757bd1cf/SelecTree-Olea_europaea3.jpg", "mime": "image/jpeg", "size": 159598, "filename": "SelecTree-Olea_europaea3.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Peppermint Tree', 'Dark green fragrant leaves, showy white flowers in spring or summer, and fruiting in the fall, this wonderful tree is native to Western Australia.', 'Peppermint Tree', '{"url": "https://dl.airtable.com/.attachments/b02370d9d2a7c897df8f64bc54b1fa88/febbbea2/SelecTree-Agonis_flexuosa.jpg", "mime": "image/jpeg", "size": 535719, "filename": "SelecTree-Agonis_flexuosa.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Pink Trumpet', 'This long-lived tree is spectacular when in full bloom with pink flowers in spring or summer. Low water needs.', 'Pink Trumpet', '{"url": "https://dl.airtable.com/.attachments/56eb3d4be9957f964449488736a06512/1d686507/SelecTree-Tabebuia_heterophylla.jpg", "mime": "image/jpeg", "size": 229380, "filename": "SelecTree-Tabebuia_heterophylla.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Silk Tree', 'This drought tolerant tree has an elegant dome shaped crown canopy, long feathery, finely textured leaves, and delicate pink or rose flowers in spring or summer. Native to southwestern and Eastern Asia.', 'Silk Tree', '{"url": "https://dl.airtable.com/.attachments/68de0d9117a1ad64271a141d0f9c295a/928eeeef/SelecTree-Albizia_julibrissin.jpg", "mime": "image/jpeg", "size": 90523, "filename": "SelecTree-Albizia_julibrissin.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Sweet Bay', 'The fragrant leaves of this tree are thick, waxy and resistant to fire. The bay leaf adds great flavor in cooking, and can be dried and bunched to deter moths indoors. Green, white or yellow flowers bloom in spring. Native to mediterranean region.', 'Sweet Bay', '{"url": "https://dl.airtable.com/.attachments/025029f7a5fc7e2ca7fa021241a0c2b4/663e5ec7/SelecTree-Laurus_nobilis2-1.jpg", "mime": "image/jpeg", "size": 192589, "filename": "SelecTree-Laurus_nobilis2-1.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'African Fern Pine', 'Drought tolerant with dense canopy, great for privacy and shade. This long living tree bears flowers in spring and cones in the fall. Native to Uganda, Ethiopia and Kenya.', 'African Fern Pine', '{"url": "https://dl.airtable.com/.attachments/4b0df1bca7509638885c56bb5d140941/a4f30da1/SelecTree-Afrocarpus_falcatus2.jpg", "mime": "image/jpeg", "size": 492785, "filename": "SelecTree-Afrocarpus_falcatus2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Aleppo Pine', 'Long living pine, great for shade and drought tolerant. Brings flowers in spring and cones in fall or winter. Mediterranean native.', 'Aleppo Pine', '{"url": "https://dl.airtable.com/.attachments/99edfcf8201ab75b4551b8a84977b775/250133ed/SelecTree-Pinus_halepensis.jpg", "mime": "image/jpeg", "size": 138497, "filename": "SelecTree-Pinus_halepensis.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Brisbane Box', 'Drought tolerant with showy and ornate white flowers in spring. Moderately dense shading capacity. Native to Australia.', 'Brisbane Box', '{"url": "https://dl.airtable.com/.attachments/45af3496dfdd393e088cb9f09c1056de/3cb73d86/SelecTree-Lophostemon_confertus.jpg", "mime": "image/jpeg", "size": 649586, "filename": "SelecTree-Lophostemon_confertus.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Canary Island Pine', 'This pine has bluish or silvery green needles, grows tall and offers moderate shade. Native of the Canary Islands of Spain and drought tolerant.', 'Canary Island Pine', '{"url": "https://dl.airtable.com/.attachments/a50a639afb2d9eb0b6b5f2c96db4fba7/1ff8d6b9/SelecTree-Pinus_canariensis.jpg", "mime": "image/jpeg", "size": 148948, "filename": "SelecTree-Pinus_canariensis.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Coast Live Oak', 'Native to central and Southern California. Hearty, long living oak with large spreading canopy and inconspicuous flowers in the spring.', 'Coast Live Oak', '{"url": "https://dl.airtable.com/.attachments/d52fb4e921fa32bbeabe295782b0971c/6ae25dbe/SelecTree-Quercus_agrifolia3.jpg", "mime": "image/jpeg", "size": 106358, "filename": "SelecTree-Quercus_agrifolia3.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Deodar Cedar', 'This tall, long living, drought tolerant tree has fragrant leaves and bark, and bears tiny flowers in fall and large beautiful cones in spring. Native Eastern Afghanistan, Northern Pakistan and North-Central India.', 'Deodar Cedar', '{"url": "https://dl.airtable.com/.attachments/84d60bc2013ef1741c077786b4c60952/fa23cd26/SelecTree-Cedrus_deodara.jpg", "mime": "image/jpeg", "size": 127037, "filename": "SelecTree-Cedrus_deodara.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Drake Chinese Elm', 'This drought tolerant tall tree offers moderate shade and inconspicuous flowers in summer or fall.', 'Drake Chinese Elm', '{"url": "https://dl.airtable.com/.attachments/95a698b8914120b298820a5515fa6419/da79e1b0/SelecTree-Ulmus_parvifolia_Drake.jpg", "mime": "image/jpeg", "size": 173431, "filename": "SelecTree-Ulmus_parvifolia_Drake.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Italian Stone Pine', 'This tall and wide canopy tree bears edible pine nuts in winter with ample growing space. Native to the Mediterranean Region. Drought tolerant.', 'Italian Stone Pine', '{"url": "https://dl.airtable.com/.attachments/300aaf7115edf0643daae8cb6eff893b/f02c22a6/pinus-pinea-tree-2.jpg", "mime": "image/jpeg", "size": 425302, "filename": "pinus-pinea-tree-2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Jacaranda', 'Big blue or lavender fragrant flowers in spring, summer or fall. Native to Argentina and Bolivia.', 'Jacaranda', '{"url": "https://dl.airtable.com/.attachments/8efd40f23b60335e6f7d017e072d3b1b/bd49fc40/SelecTree-Jacaranda_mimosifolia_2.jpg", "mime": "image/jpeg", "size": 130406, "filename": "SelecTree-Jacaranda_mimosifolia_2.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Tipu Tree', 'This tree offers wide and dense canopy and cheerful yellow or orange flowers in summer. Native to Bolivia and Southern Brazil.', 'Tipu Tree', '{"url": "https://dl.airtable.com/.attachments/d30d8e10cb9e45901f6e58a8bd94c245/ed725c54/tipuana-tipu-tree-baldwin.jpg", "mime": "image/jpeg", "size": 183042, "filename": "tipuana-tipu-tree-baldwin.jpg"}'::jsonb, 0), ('393ff77f-40d3-55de-93db-0a53969b400b', 'Other', 'Trees are key to fighting urban heat', 'Other', '{"url": "https://dl.airtable.com/.attachments/6dc994019ff52fe34a8b1658161544bc/0c9a0b8f/Group1131.jpg", "mime": "image/jpeg", "size": 183042, "filename": "tree.jpg"}'::jsonb, 0);
